import { useLayoutEffect } from 'react';
import { connect } from 'react-redux';
import { Redirect, Route, withRouter } from "react-router-dom";
import { compose } from 'redux';
import './App.css';
import GameStart from './components/gameStart';
import Game from './components/game';
import { getConfigState } from './redux/config-reducer';
import { getDataState } from './redux/data-reducer';
import { getGameState } from './redux/gameState-reducer';

const App = (props) => {
  useLayoutEffect(() => {
    props.getConfigState();
    props.getDataState();
    props.getGameState();
  }, []);
  return (
    <div className="App">
      <Route exact path="/">
        <Redirect to="/gameStart" />
      </Route>
      <Route path='/gameStart' render={() => <GameStart />} />
      <Route path='/game' render={() => <Game />} />
    </div>
  );
}

export default compose(withRouter, connect(null, { getConfigState, getDataState, getGameState }))(App)
